// https://jsonplaceholder.typicode.com/todos
import{useEffect, useState} from "react"

function Map(){
    const [data,setData]=useState("")
    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/todos")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
        })
    })
    return(
        <div>
        <h1>Fetch data from backend</h1>
        <table>
            <thead>
                <tr>
                    <th>userId</th>
                    <th>Id</th>
                    <th>Title</th>
                </tr>
            </thead>
            <tbody>
                  {data.map((item)=>(


                <tr>
                    <td>{item.userId}</td>
                     <td>{item.id}</td>
                    <td>{item.title}</td>
                     
                 </tr> 
                                ))}  
            </tbody>
        </table>
        </div>
    )
}
export default Map;
